import { 
    SET_STATE
 } from './actionTypes';

const DashboardReducer = (state, action) => {
    const { type, payload = { ...data, field } } = action;

    switch (type) {
        case SET_STATE:
            return {
                ...state,
                [field]: data,
            }
        default:
            return state;
    }
}

export default DashboardReducer;
